const ProvinceData = ({province}) => {
    return (
        <>
            {
                province.map((curProvince) => {
                    const {displayName, value} = curProvince;

                    return (
                        <tr>
                            <td>
                                {displayName}
                            </td>
                            <td>
                                {value}
                            </td>
                        </tr>
                    )
                })
            }
        </>
    )
}

export default ProvinceData;
